package dev.tonholo.awesomeapp.diimport dagger.Moduleimport dagger.Providesimport dagger.hilt.InstallInimport dagger.hilt.components.SingletonComponentimport dagger.multibindings.ElementsIntoSetimport dev.tonholo.awesomeapp.navigation.Destinations@Module@InstallIn(SingletonComponent::class)object AppNavigationModule {    @[Provides ElementsIntoSet]    fun provideFeatureDestination() =        setOf(            Destinations.Feed,            Destinations.ImageDetails,        )}